const defaultState = {
    retults : []
}

const showPost = (state = defaultState, action) =>{
    switch(action.type){
        case 'GOT_RESULT' :{
            return {
                state,
                results : action.payload
            }
        }
        default: {
            return {
                state
            }
        }
    }

}
export default showPost
